import React from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import { Link, withRouter } from "react-router-dom";
import './Navbar.css';

function NavbarComponent(props) {
    return (
        <Navbar class="navbar navbar-expand-lg navbar-dark shadow-5-strong">
            <div class="container">
                <Navbar.Brand><Link to="/"><img src="img/logo.png" alt="" title="" height="40px" width="40px"></img></Link></Navbar.Brand>
                <Nav className="ml-auto">
                    <Nav.Link href="/"><p>HOME</p></Nav.Link>
                    <Nav.Link href="/final_project"><p>FINAL PROJECT</p></Nav.Link>
                </Nav>
            </div>
        </Navbar>
    )
}

export default NavbarComponent
